  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link I at waypoints along its track during nineteen dives of the 2005
  \"Life on the Edge\" expedition sponsored by the National Oceanic and Atmospheric
  Administration (NOAA) Office of Ocean Exploration, October 16 through November 4,
  2005. Measurements and information include sub's position and depth; personnel assignments;
  dive, mission, target, and vehicle ID's; dive comments; hyperlinks to CTD plots;
  water temperature; and salinity. The Marine Operations Division of the Harbor Branch
  Oceanographic Institution provided the original submersible data.\",\n\t\"owner_org\":
